  async function getTexture(texture) {
    if (textures[texture].startsWith("data:image/png;base64,")) return textures[texture]
    const data = await new Promise(async fulfil => {
      const reader = new FileReader()
      reader.onload = e => fulfil(e.target.result)
      reader.readAsDataURL(new Blob([await fetch(textures[texture]).then(e => e.arrayBuffer())], { type: "image/png" }))
    }).catch(() => {})
    textures[texture] = data
    return data
  }

  async function addText(text, args) {
    const newCubes = []
    const newTextures = []
    Undo.initEdit({
      elements: newCubes,
      outliner: true,
      textures: newTextures
    })
    const data = await getTexture(args.texture)
    const img = (await new Promise(fulfill => new THREE.TextureLoader().load(data, fulfill, null, fulfill))).image
    const canvas = document.createElement("canvas")
    canvas.width = img.width
    canvas.height = img.height
    const ctx = canvas.getContext("2d")
    ctx.filter =`hue-rotate(${args.hue}deg)`
    ctx.drawImage(img, 0, 0)
    ctx.filter ="hue-rotate(0deg)"
    ctx.globalCompositeOperation = args.blend
    ctx.fillStyle = args.colour.toHexString()
    ctx.fillRect(0, 0, canvas.width, canvas.height)
    ctx.globalCompositeOperation = "destination-in"
    ctx.drawImage(img, 0, 0)
    const texture = new Texture({ name: `${makeName(text)}.png` }).fromDataURL(canvas.toDataURL()).add()
    newTextures.push(texture)
    const words = text.split(" ")
    let group
    let offset = 0
    if (words.length === 1) {
      [group] = makeWord(text, offset, "root", {
        texture: texture.uuid,
        row: args.row,
        type: args.type,
        newCubes
      })
    } else {
      group = new Group(makeName(text)).init()
      for (const part of words) {
        const [word, newOffset] = makeWord(part, offset, group, {
          texture: texture.uuid,
          row: args.row,
          type: args.type,
          newCubes
        })
        offset = newOffset + 8
      }
    }
    group.addTo().select()
    let min = Infinity
    let max = -Infinity
    for (const cube of Cube.selected) {
      min = Math.min(min, cube.from[0], cube.to[0])
      max = Math.max(max, cube.from[0], cube.to[0])
    }
    const width = (max - min) / 2 + 8
    for (const cube of Cube.selected) {
      cube.from[0] += width
      cube.to[0] += width
    }
    if (args.type === "bottom") {
      group.rotation[0] = -90
    }
    Canvas.updateView({
      elements: Cube.selected,
      groups: [Group.selected]
    })
    Undo.finishEdit("Add Minecraft title text")
    updateSelection()

  }

  function makeWord(text, offset, parent, args) {
    const word = new Group(makeName(text))
    word.addTo(parent).init()
    for (const char of text) {
      if (characters[char]) {
        const [character, width] = makeCharacter(char, offset, word, args)
        offset += width
      }
    }
    return [word, offset]
  }

  function makeCharacter(char, offset, parent, args) {
    let min = Infinity
    let max = -Infinity
    const cubes = []
    for (const element of characters[char]) {
      if (!element.parsed) {
        element.parsed = true
        for (const [direction, uv] of Object.entries(element.faces)) {
          element.faces[direction] = { uv }
        }
      }
      min = Math.min(min, element.from[0], element.to[0])
      max = Math.max(max, element.from[0], element.to[0])
      const cube = new Cube(element)
      cube.autouv = 0
      for (const key in cube.faces) {
        const readFace = element.faces[key]
        const newFace = cube.faces[key]
        if (readFace === undefined) {
          newFace.texture = null
          newFace.uv = [0, 0, 0, 0]
        } else {
          newFace.texture = args.texture
          newFace.uv.forEach((n, i) => {
            newFace.uv[i] = readFace.uv[i] * UVEditor.getResolution(i % 2) / 16
          })
        }
      }
      cubes.push(cube)
    }
    const character = new Group(makeName(char))
    character.addTo(parent).init()
    for (const cube of cubes) {
      cube.to[0] -= offset + max
      cube.from[0] -= offset + max
      if (args.type === "bottom") {
        cube.to[1] *= 1.75
        cube.from[1] *= 1.75
        cube.to[1] -= args.row * 84 + 86
        cube.from[1] -= args.row * 84 + 86
        if (cube.to[2] > cube.from[2]) {
          cube.to[2] += 20
        } else {
          cube.from[2] += 20
        }
      } else {
        cube.to[1] += args.row * 48
        cube.from[1] += args.row * 48
      }
      cube.addTo(character).init()
      args.newCubes.push(cube)
    }
    return [character, max - min]
  }

  function makeName(str) {
    return str.replace(/\s/g, "_").replace(/ðŸ˜³/g, "a").replace(/ðŸ˜©/g, "'")
  }
